import React from "react";
// import video0 from "../assets/Images/video-list-0.jpg";

export default function video() {
  return (
    <div className="video">
      <video className="video__playing" controls>
        <source src="../assets/Video/BrainStation Sample Video.mp4" />
      </video>
    </div>
  );
}
